using namespace std;

int n, m, k;

int dp(int a, int b) {
	if (a == m && b == n) {
		return 1;
	}
	if (a > m || b > n) {
		return 0;
	}
	int s = 0;
	for (int i = 0; i <= k; i++) {
		s += dp(a + i, b + 1);
	}
	return s;
}

